        .card {
            background-color: white;
            border-radius: 0.5rem;
            box-shadow: 0 25px 50px -12px rgba(0, 0, 0, 0.25);
            padding: 2.5rem;
            max-width: 28rem;
            width: 100%;
            margin: 1.5rem;
        }
        .logo-svg{
            
            max-width: max-content;
            margin: 0 auto;
            padding-bottom: 1.5rem
        }
        .card h2 {
            font-size: 1.25rem;
            font-weight: 600;
            color: #111827;
            margin-bottom: 1.5rem;
            text-align: center;
        }

        .card p {
            font-size: 1rem;
            font-weight: 500;
            
            margin-bottom: 1rem;
            text-align: center;
        }
        .form-group {
            margin-bottom: 1rem;
        }
        .form-group label {
            display: block;
            color: #4b5563;
            margin-bottom: 0.5rem;
        }
        .form-group input {
            width: 100%;
            padding: 0.5rem 1rem;
            border: 1px solid #d1d5db;
            border-radius: 0.375rem;
            outline: none;
            background-color: white;
            transition: border-color 0.15s ease-in-out, box-shadow 0.15s ease-in-out;
        }
        .form-group input:focus {
            border-color: #75BFC0;
            box-shadow: 0 0 0 2px rgba(117, 191, 192, 0.5);
        }
        .btn {
            display: block;
            width: 100%;
            padding: 0.5rem 1rem;
            background-color: #75BFC0;
            color: white;
            border: none;
            border-radius: 0.375rem;
            text-align: center;
            cursor: pointer;
            transition: background-color 0.15s ease-in-out;
        }
        .btn:hover {
            background-color: #5FA4A5;
        }
        .btn:focus {
            box-shadow: 0 0 0 2px rgba(117, 191, 192, 0.5);
        }
        .alert-danger{
            background-color: #FFD700;
            padding: 8px 10px;
            text-align: center;
            max-width: max-content;
            border-radius: 0.375rem;
            margin: 10px auto
        }

        ::-moz-selection { /* Code for Firefox */
            
            background: #75BFC0 !important;
        }

        ::selection {
            
            background: #75BFC0 !important;
        }

        

        
        
